import React from 'react'

export default class CatalogsSection extends React.Component{
	render(){
		return(
				<div className="main">

					<section className=".todas-as-telas">
						<h2>Assista aonde quiser, em todos os dispositivos</h2>

						<div className="telas">
							<img src="/img/todas-as-telas.png"/>
						</div>
					</section>
				</div>
		)
	}
}
